import { Skeleton } from '@mui/material';
import React from 'react';

const DotsLaoding = () => {
	return (
		<>
			<Skeleton
				animation='wave'
				style={{
					width: '100px',
					height: '50px',
				}}
			/>
		</>
	);
};

export default DotsLaoding;
